package com.amir.weathora.dataimport com.squareup.moshi.Jsondata class WeatherDtoData(    val time : List<String>,    @field:Json(name = "temperature_2m")    val temperatures : List<Float>,    @field:Json(name = "weathercode")    val weatherCodes : List<Int>,    @field:Json(name = "relativehumidity_2m")    val humidities : List<Float>,    @field:Json(name = "windspeed_10m")    val windSpeeds : List<Float>,    @field:Json(name = "pressure_msl")    val pressures : List<Float>)